import logo from './avatar.png';
import './App.css';
import Greet from './StartPage/components/startpage'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi! I'm Isabella. Welcome to my story.
        </p>
        <a
          className="App-link"
          href="./StartPage/components/startpage.js"
          target="_blank"
          rel="noopener noreferrer"
        >
          Start
        </a>
      </header>
    </div>
  );
}

export default App;
